import React from "react";
import "./App.css";
import { Home, Rules, EasyLevel, DifficultLevel } from "./components";
import { Routes, Route } from "react-router";

const App = () => (
  <div>
    <Navigation />
    <Routes>
      <Route exact path="/" element={<Home />} />
      <Route exact path="/home" element={<Home />} />
      <Route exact path="rules" element={<Rules />} />
      <Route exact path="easy level" element={<EasyLevel />} />
      <Route exact path="difficult level" element={<DifficultLevel />} />
    </Routes>
  </div>
);

export default App;
